INSERT INTO `books` VALUES (1,'Đang cập nhật','Truyện tranh Thần Hồn Võ Đế được cập nhật nhanh và đầy đủ nhất tại Argon Comic. Bạn đọc đừng quên để lại bình luận và chia sẻ, ủng hộ Argon Comic ra các chương mới nhất của truyện Thần Hồn Võ Đế.','THẦN HỒN VÕ ĐẾ','UPDATING','https://img.dtruyen.com/public/images/large/hondevothanu4S7xag.jpg',_binary '\0'),(2,'Đang cập nhật','Chín ngàn năm trước, Tiên Võ Đế Tôn suất lĩnh trăm vạn thần tướng đánh vào Thái Cổ Hồng Hoang, lại không một người trở về, chỉ có một sợi chân hỏa còn sót lại thế gian. Chín ngàn năm sau, phế đồ môn pháiDiệp Thần, bị đuổi khỏi tông môn, không thể về nhà, ','TIÊN VÕ ĐẾ TÔN','UPDATING','https://cdn.myanimelist.net/images/anime/1071/135255.jpg',_binary '\0'),(3,'Đang cập nhật','Tôi là một cậu trai ước mơ làm \"chúa tể bóng tối\", chèo lái câu chuyện trong bóng tối, bí mật phô bày năng lực, tên là Shido. Vừa mới hớn hở vì được chuyển sinh đến thế giới khác và quyết định \"mình sẽ là chúa tể bóng đêm, ngấm ngầm loại bỏ giáo phái đen ','TA MUỐN TRỞ THÀNH CHÚA TỂ BÓNG TỐI!','UPDATING','https://cdn.myanimelist.net/images/anime/1874/121869.jpg',_binary '\0'),(4,'Đang cập nhật','Có một thế giới nơi phép thuật có thể chi phối mọi thứ nhưng sâu trong rừng có một thanh niên dành thời gian để luyện tập cơ bắp. Mặc dù không thể sử dụng phép thuật, nhưng cậu ta có một cuộc sống yên bình với cha mình...','MASHLE: MUSCLES AND MAGIC','UPDATING','https://m.media-amazon.com/images/M/MV5BM2M1Yzc5OTMtNWQxYS00NTg5LThiYjQtODRhZGMwODVkNjAyXkEyXkFqcGdeQXVyMTEzMTI1Mjk3._V1_.jpg',_binary '\0'),(5,'Đang cập nhật','Ta tên Mạnh Xuyên, năm nay mười lăm tuổi, là Đông Ninh phủ \"Kính Hồ đạo viện\" đương đại đại sư huynh.','THƯƠNG NGUYÊN ĐỒ','UPDATING','https://nae.vn/ttv/ttv/public/images/story/069a21a830ea41a1ddc9d2e603947f9de83cf912d335d388fcc26b48f4796304.jpg',_binary '\0'),(6,'Đang cập nhật','Truyện tranh Lăng Thiên Thần Đế được cập nhật nhanh và đầy đủ nhất tại NetTruyen. Bạn đọc đừng quên để lại bình luận và chia sẻ, ủng hộ NetTruyen ra các chương mới nhất của truyện Lăng Thiên Thần Đế.','LĂNG THIÊN THẦN ĐẾ','UPDATING','https://i7.bumcheo.info/manga/24/24878/00.thumb_500x.jpg',_binary '\0'),(7,'Đang cập nhật','Truyện tranh Tu La Kiếm Tôn được cập nhật nhanh và đầy đủ nhất tại NetTruyen. Bạn đọc đừng quên để lại bình luận và chia sẻ, ủng hộ NetTruyen ra các chương mới nhất của truyện Tu La Kiếm Tôn.','TU LA KIẾM TÔN','UPDATING','https://lh6.googleusercontent.com/proxy/7_8ydJCZ_q3WU6nYuDe2JlY7C3W9WlMRWNOZGdXH0kYJCOnI7W5WPyQp_LYjqaAH8mSNKCZU-deEfp8kajEL5SDyQD1en_LZ5PTEBDm9Hyfp_jA1MEplmU8BtllzUtdUJMYrP0g',_binary '\0'),(8,'Đang cập nhật','Vốn là học bá IQ cao thời hiện đại, bậc thầy chế tạo thủ công, bởi vì thức đêm làm việc quá sức mà chết, xuyên không đến thế giới tu tiên huyền nguyên đại lục nhập vào thân thể một tên phú nhị đại trong một gia tộc nghèo Tô Cảnh Nghiêu dựa vào tri thức hi','KHOA KỸ ĐẠI TIÊN TÔNG','UPDATING','https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcTVp7X2QVd8OIFpvpBqXcFBCr08ULnWVxSiOtTkpoauXA&s',_binary '\0'),(9,'Đang cập nhật','Thiên Vũ đại lục nhất đại truyền kỳ Tần Trần, bởi vì bạn tốt phản bội bất ngờ ngã xuống Võ vực. 300 năm sau, hắn chuyển sinh ở một cái nhận hết ức hiếp vương phủ con riêng trên người, lợi dụng kiếp trước trình độ, ngưng thần công, luyện thần đan, đi n','VÕ THẦN CHÚA TỂ','UPDATING','https://file.hstatic.net/200000122283/file/demon_slayer_kimetsu_no_yaiba__thanh_guom_diet_quy__853198b1021746c99324b768ff4542f8_grande.jpg',_binary '\0'),(10,'Đang cập nhật','Thần đồng tên giang mới có bảy tuổi sinh trưởng quá nhanh nên bị đoản mệnh, vì là khôi phục cuộc sống bình thường, mang theo ký ức trong cơ thể một vị đại thần tiên xông vào Tiên giới, từ đây đi tới trở thành bá chủ Tiên giới mở ra con đường truyền kỳ...','TA LÀ ĐẠI THẦN TIÊN','UPDATING','https://cdnntx.com/nettruyen/thumb/jujutsu-kaisen-chu-thuat-hoi-chien.jpg',_binary '\0'),(11,'Đang cập nhật','Đỉnh cao của võ đạo, là cô độc, là tịch mịch, là cuộc hành trình dài đằng đẵng, là ở nơi cao thì phải chịu lạnh. Trưởng thành trong nghịch cảnh, cầu sinh trong đường cùng mới có thể đột phá cực đạo võ đạo. Dương Khai, đệ tử thử việc quét rác của Lăng Tiêu','VÕ LUYỆN ĐỈNH PHONG','UPDATING','https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcQnxQLSdSxqwQjki5Mg6b4xsLwBPbmA7BtFZ17gHUP7jQ&s',_binary '\0'),(12,'Đang cập nhật','Nữ chính của chúng ta, Ninh Đóa Đóa, sau khi chuyển trường từ thành phố S về thành phố Q ven biển, ngày đầu tiên đi học, đã phát hiện ra một anh học bá trâu nhất trường, cũng là đệ nhất soái cơ, đang trốn một góc khóc hu hu do cô lạc đường khi tới trường,','THANH NINH CHI HẠ ','UPDATING','https://photo2.tinhte.vn/data/attachment-files/2022/04/5948817_61.jpg',_binary '\0'),(13,'Đang cập nhật','Yu Ijin - người duy nhất sống sót sau một vụ tai nạn máy bay thảm khốc khi anh còn nhỏ. Sau quãng thời gian 10 năm trở thành lính đánh thuê để hoàn thành giao kèo với người đã cứu mình, cậu đã trở về với gia đình ở quê hương. Một cuộc sống mới và cả sóng ','BẠN HỌC CỦA TÔI LÀ LÍNH ĐÁNH THUÊ','UPDATING','https://s1.fastscans.net/ban-hoc-cua-toi-la-linh-danh-thue/thumbnail/bhctlldt.png',_binary '\0'),(14,'Đang cập nhật','Trong chín năm, tôi luôn ở vị trí đầu tiên trong suốt cuộc đời học sinh của mình. Tôi nghĩ rằng một khi tôi vào cao trung, mọi thứ sẽ vẫn như cũ. Nhưng, tên khốn nào đó đã chiếm vi trí của tôi! nhưng không, tôi không muốn từ bỏ vị trí của mình!!!!','TÌNH YÊU TUỔI TRẺ','UPDATING','https://mangadex.org/covers/f664ae8a-7c44-4548-a60b-5cb6f00dd142/280887f7-3724-4b18-87fa-3cc6b7fec236.png.512.jpg',_binary '\0'),(15,'Đang cập nhật','Phách lối không phải là sai, cuồng vọng không phải tội, ta bản mạnh nhất, không cần để ý! Giáo hoa, người mẫu, ngự tỷ, ta đã thích, mang tới liền!','HỌC VIỆN CAO THỦ','UPDATING','http://alotruyentranh.com/ImageComicBig/hoc-vien-cao-thu-17424.jpg',_binary '\0'),(16,'Trọng Sinh Chi Ngược Tra Nữ Vương','Động tác tiêu chuẩn sau khi trọng sinh là gì? Tay trái đảo lộn cả nhà tra nam, tay trái ôm chặt đùi bá tổng. Cô vợ nhỏ:’’Chồng, em bị cấp trên tiền mãn kinh mắng là chó, làm sao đây?’’. Bá tổng: ‘’Đã sắp xếp xong, cho nữ vương đại nhân thăng chức để cấp t','SỰ TRẢ THÙ CỦA NỮ VƯƠNG','UPDATING','https://i1.wp.com/s2.anhvip.xyz/comics/su-tra-thu-cua-nu-vuong-1627360136.jpg',_binary '\0'),(17,'Đang cập nhật','Một cuộc giao dịch đã bắt cô ấy phải hiến thân cho người đàn ông tôn kính nhất, đáng sợ nhất ở thành phố Đông Lăng. Ban ngày, cô ấy là một người con gái bình thường như bao cô gái khác nhưng ban đêm cô lại trở thành món đồ chơi của anh ta… Hai tay cô bị é','DANH MÔN CHÍ ÁI','UPDATING','http://alotruyentranh.com/ImageComicBig/danh-mon-chi-ai-15688.jpg',_binary '\0'),(18,'Đang cập nhật','Mọi người dường như không nhận ra được sự tồn tại của tôi nhưng mà tại sao Kubo-san lại...!!','KUBO WONT LET ME BE INVISIBLE','UPDATING','https://cdn.myanimelist.net/images/anime/1818/132330.jpg',_binary '\0'),(19,'Đang cập nhật','Một học sinh lười biếng và một giáo viên nghiêm túc. Thoạt nhìn, có vẻ như họ đang ở trong tình trạng tồi tệ, nhưng mọi thứ trở nên khác biệt sau giờ học ...','THE TEACHER CAN NOT TELL ME LOVE','UPDATING','https://cdn.mangaclash.com/manga_5fdf114caf71c/f19f8e897023dc7e7159893c49b9be75/1.jpg',_binary '\0'),(20,'Nguyễn Văn A','Vào một ngày đẹp trời, tôi thức dậy và đột nhiên trở thành Quỷ vương, người mang trách nhiệm bảo vệ dungeon. Ở một thế giới tràn ngập bởi bạo lực. Những con quái khổng lồ ở khắp nơi, đấu tranh hằng ngày để sinh tồn. Tôi không còn lựa chọn nào khác ngoài t','MAOU NI NATTE NODE, DUNGEON TSUKUTTE JINGAI MUSUME TO HONOBONO SURU','FULL','https://static.wikia.nocookie.net/maou-ni-natta-node/images/0/01/LN_V13-01.jpg/revision/latest?cb=20220414213635',_binary '\0'),(31,'q','q','q','UPDATING','https://firebasestorage.googleapis.com/v0/b/comic-c7562.appspot.com/o/images%2Fc3cea109-51ad-4731-8593-0c55393f2687?alt=media&token=19b04173-de5c-4fe7-b7e7-92873efa548f',_binary ''),(32,'w','w','w','UPDATING','https://firebasestorage.googleapis.com/v0/b/comic-c7562.appspot.com/o/images%2Fa89bc568-c975-4ae5-bf7a-68e3305cc559?alt=media&token=90db24d5-5631-43f4-94f7-3e3e404448b5',_binary ''),(33,'nguyễn a','abc','truyện kiều','UPDATING','https://firebasestorage.googleapis.com/v0/b/comic-c7562.appspot.com/o/images%2F943b7c32-f7c8-4469-bce3-743b2f0f5ed0?alt=media&token=ac14c396-aeaf-449a-9ed8-b1d4290d61a9',_binary '');
