INSERT INTO `categories` VALUES (1,'Books with imaginative or fanciful themes, usually involving magic, supernatural events, or mythical creatures.','Tưởng tượng'),(2,'Books that explore speculative concepts such as futuristic science and technology, space exploration, time travel, and extraterrestrial life.','Khoa học viễn tưởng'),(3,'Books focused on romantic love relationships, typically featuring passionate attraction and emotional attachment between characters.','Lãng mạn'),(4,'Books involving a mysterious event or crime that needs to be solved by the protagonist.','Bí ẩn'),(5,'Books that create excitement, tension, and anticipation in the reader, often involving danger, suspense, and unexpected twists.','Kinh dị'),(6,'Books designed to evoke fear, dread, and terror in readers, often featuring supernatural elements, monsters, or psychological suspense.','Rùng rợn'),(7,'Books set in the past that blend fictional characters and events with historical settings and contexts.','Tiểu thuyết lịch sử'),(8,'Books based on real events, facts, and information, typically covering topics such as history, biography, science, self-help, and memoirs.','Phi hư cấu'),(9,'Books that narrate the life story of a real person, providing insights into their achievements, experiences, and contributions.','Tiểu sử'),(10,'Books aimed at helping individuals improve themselves, overcome challenges, and achieve personal growth and success.','Tự lực');
